        <div id="u742_text" class="text ">
          <p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">浔阳江头夜送客，枫叶荻花秋瑟瑟。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">主人下马客在船，举酒欲饮无管弦。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">醉不成欢惨将别，别时茫茫江浸月。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">忽闻水上</span><span style="font-family:'楷体';font-weight:400;color:#FFFF00;">琵琶</span><span style="font-family:'楷体';font-weight:400;">声，主人忘归客不发。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">寻声暗问弹者谁？</span><span style="font-family:'楷体';font-weight:400;color:#FFFF00;">琵琶</span><span style="font-family:'楷体';font-weight:400;">声停欲语迟。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">移船相近邀相见，添酒回灯重开宴。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">千呼万唤始出来，犹抱</span><span style="font-family:'楷体';font-weight:400;color:#FFFF00;">琵琶</span><span style="font-family:'楷体';font-weight:400;">半遮面。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">转轴拨弦三两声，未成曲调先有情。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">弦弦掩抑声声思，似诉生平不得志。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">低眉信手续续弹，说尽心中无限事。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">轻拢慢捻抺复挑，初为霓裳后六么。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;">大弦嘈嘈如急雨，小弦切切如私语。</span></p><p style="font-size:18px;"><span style="font-family:'楷体';font-weight:400;"><br></span></p><p style="font-size:28px;"><span style="font-family:'Arial Normal', 'Arial';font-weight:400;">&nbsp;</span></p>
        </div>
